const pipeline = (x) => x();

const importers = [
  async (path) => {
    if (!/^\.[\\/](?:ui-components(?:\/(?!\.)(?:(?:(?!(?:^|\/)\.).)*?)\/|\/|$)(?!\.)(?=.)[^/]*?\.(mdx|stories\.(js|jsx|ts|tsx)))$/.exec(path)) {
      return;
    }

    const pathRemainder = path.substring(16);
    return import(
      /* webpackChunkName: "[request]" */
      /* webpackInclude: /(?!.*node_modules)(?:\/ui-components(?:\/(?!\.)(?:(?:(?!(?:^|\/)\.).)*?)\/|\/|$)(?!\.)(?=.)[^/]*?\.(mdx|stories\.(js|jsx|ts|tsx)))$/ */
      './ui-components/' + pathRemainder
    );
  }

];

export async function importFn(path) {
  for (let i = 0; i < importers.length; i++) {
    const moduleExports = await pipeline(() => importers[i](path));
    if (moduleExports) {
      return moduleExports;
    }
  }
}
